import Layout from "./components/layout";
import Profile from "./components/profile";
import Repositories from "./components/repositories";
import ResetCSS from "./global/resetCSS";

function App() {
  return (
    <main>
      <ResetCSS />
        <Layout>
          <Profile />
          <Repositories />
        </Layout>
    </main>
  );
}

export default App;
